import React from 'react';
import styles from './Profile.module.scss'
import dash from '../../images/dashPic.png'
import invest from '../../images/investPic.png'
import prof from '../../images/profPic.png'
import props from '../../images/propsPic.png'
import { useState } from 'react';

export const Profile = () => {
    const [id, setId] = useState('0')
    console.log(id)
    var buttons = document.getElementsByClassName('butt'),
    forEach = Array.prototype.forEach;

forEach.call(buttons, function (b) {
    b.addEventListener('click', addElement);
});

function addElement(e) {
    var addDiv  = document.createElement('div'),
        mValue  = Math.max(this.clientWidth, this.clientHeight),
        rect    = this.getBoundingClientRect();
        sDiv    = addDiv.style,
        px      = 'px';

    sDiv.width  = sDiv.height = mValue + px;
    sDiv.left  = e.clientX - rect.left - (mValue / 2) + px;
    sDiv.top   = e.clientY - rect.top - (mValue / 2) + px;

    addDiv.classList.add('pulse');
    this.appendChild(addDiv);
}
    


    return (
        <div className={styles.profileWrap}>
            <div className={styles.profileContainer}>
                <div className={styles.profileMenuContainer}>
                    <div className={styles.menuContent}>
                            <a id='zero' class='butt' className={id === '0' ? styles.active : styles.default} onClick={event => setId('0')}><img src={dash} alt="alt" height="17" width="17"></img><h4>Dashboard</h4></a>
                            <a id='one' class='butt' className={id === '1' ? styles.active : styles.default} onClick={event => setId('1')}><img src={props} alt="alt" height="17" width="17"></img><h4>My Properties</h4></a>
                            <a id='two' class='butt' className={id === '2' ? styles.active : styles.default} onClick={event => setId('2')}><img src={invest} alt="alt" height="17" width="17"></img><h4>Investment Properties</h4></a>
                            <a id='four' class='butt' className={id === '3' ? styles.active : styles.default} onClick={event => setId('3')}><img src={prof} alt="alt" height="17" width="17"></img><h4>My Professionals</h4></a>
                    </div>
                </div>
                <div className={styles.profileCurrentContainer}>
                    <div className={styles.currentContent}></div>
                </div>
            </div>
        </div>
    )
}

export default Profile;
